import React from 'react';
import UsersList from './UsersList';

/**
 * DUMMY DATA
 */
const DATA = [
  {
    fullName: 'John Doe',
    userId: 'john.doe100',
    email: 'john@mail.com',
    accessType: 'updates'
  },
  {
    fullName: 'Jeanne Doe',
    userId: 'jeanne.doe200',
    email: 'jeanne@mail.com',
    accessType: 'updates'
  },
  {
    fullName: 'Bobby Doe',
    userId: 'bobby.doe300',
    email: 'bobby@mail.com',
    accessType: 'updates'
  }
];

class Users extends React.Component {
  render() {
    return (
      <div>
        <h1>Users</h1>
        <UsersList
          key={user.userId}
          fullName={user.fullName}
          userId={user.userId}
          email={user.email}
          accessType={user.accessType}
          delete={() => this.handleDelete(user.userId)}
        />
      </div>
    );
  }
}

export default Users;
